  schema: {
    additionalProperties: false,
    description:
      "Mexican customs pedimento document schema for imports/exports",
    properties: {
      pedimentNumber: {
        description: "Customs declaration number in format YY MM AAAA NNNNNNN",
        type: "string",
      },
      operationType: {
        anyOf: [
          {
            type: "string",
          },
          {
            type: "null",
          },
        ],
        description: "Type of operation - EXP for exports, IMP for imports",
      },
      pedimentCode: {
        description:
          "Pedimento code classification (e.g., V1 for virtual pedimento)",
        type: "string",
      },
      regime: {
        description:
          "Customs regime code (e.g., EXD for definitive export, IMD for definitive import)",
        type: "string",
      },
      destination: {
        description: "Destination code for the shipment",
        type: "string",
      },
      exchangeRate: {
        anyOf: [
          {
            type: "number",
          },
          {
            type: "null",
          },
        ],
        description:
          "Exchange rate MXN per USD at the time of declaration. If not provided, it can be calculated from commercialTotalMXN / dollarValue.",
      },
      customsValue: {
        description: "Total customs value of goods in USD (sum of VAL ADU/USD)",
        type: "number",
      },
      grossWeight: {
        description: "Total gross weight of the shipment in kilograms",
        type: "number",
      },
      customsOffice: {
        description: "Entry/Exit customs office code",
        type: "string",
      },
      transportation: {
        additionalProperties: false,
        description: "Transportation methods used for the shipment",
        properties: {
          entryExit: {
            description: "Entry/Exit transportation code",
            type: "string",
          },
          arrival: {
            description: "Arrival transportation method code",
            type: "string",
          },
          departure: {
            description: "Departure transportation method code",
            type: "string",
          },
        },
        required: ["entryExit", "arrival", "departure"],
        type: "object",
      },
      dollarValue: {
        description: "Total customs value of goods in USD (sum of VAL ADU/USD)",
        type: "number",
      },
      commercialValue: {
        description:
          "Total commercial value of goods in USD (converted if needed)",
        type: "number",
      },
      taxId: {
        description: "Mexican tax identification number (RFC)",
        type: "string",
      },
      companyName: {
        description: "Legal name or business name of the importer/exporter",
        type: "string",
      },
      personalId: {
        description: "Personal identification code (CURP)",
        type: "string",
      },
      address: {
        description: "Complete address of the importer/exporter",
        type: "string",
      },
      lineItems: {
        description: "List of all goods being imported/exported",
        items: {
          additionalProperties: false,
          description:
            "Single product line extracted from the pedimento table with customs classification and valuation details.",
          properties: {
            sequenceNumber: {
              description: "Sequential line number from the 'SEC' column",
              type: "string",
            },
            productCode: {
              description: "8-digit tariff code (FRACCION/HS)",
              type: "string",
            },
            exchangeRate: {
              anyOf: [
                {
                  type: "number",
                },
                {
                  type: "null",
                },
              ],
              description:
                "Implied currency conversion ratio between the larger commercial total and the smaller customs/base total for the same goods. Compute as commercialValue / customsValueUSD. Prefer the dominant/consistent ratio across multiple lines. Output as MXN per USD.",
            },
            unitPrice: {
              anyOf: [
                {
                  type: "number",
                },
                {
                  type: "null",
                },
              ],
              description:
                "Per-unit commercial price in the same currency as commercialValue. Select or compute the value that makes unitPrice × quantityUMC ≈ commercialValue within a small tolerance (e.g., ≤2%). If not explicitly present, compute commercialValue / quantityUMC.",
            },
            commercialValue: {
              anyOf: [
                {
                  type: "number",
                },
                {
                  type: "null",
                },
              ],
              description:
                "Commercial total for the goods (same currency as unitPrice). Choose the total that best matches unitPrice × quantityUMC within tolerance. When multiple candidates exist, prefer the one that yields a stable exchangeRate = commercialValue / customsValueUSD.",
            },
            customsValueUSD: {
              anyOf: [
                {
                  type: "number",
                },
                {
                  type: "null",
                },
              ],
              description:
                "Customs/base total expressed in USD. Identify the smaller total that, paired with commercialValue, produces a consistent exchangeRate across lines (exchangeRate = commercialValue / customsValueUSD). If not explicit, compute as commercialValue / exchangeRate.",
            },
            quantityUMC: {
              anyOf: [
                {
                  type: "integer",
                },
                {
                  type: "null",
                },
              ],
              description: "Commercial quantity (CANTIDAD UMC)",
            },
            umcCode: {
              anyOf: [
                {
                  type: "string",
                },
                {
                  type: "null",
                },
              ],
              description: "Commercial unit of measure code (UMC)",
            },
            description: {
              anyOf: [
                {
                  type: "string",
                },
                {
                  type: "null",
                },
              ],
              description: "Human-readable description of the goods",
            },
            notes: {
              anyOf: [
                {
                  type: "string",
                },
                {
                  type: "null",
                },
              ],
              description: "Additional notes or part numbers",
            },
            addedValueFactor: {
              anyOf: [
                {
                  type: "number",
                },
                {
                  type: "null",
                },
              ],
              description: "Added value factor (VAL. AGREG.)",
            },
            shipmentCountry: {
              anyOf: [
                {
                  type: "string",
                },
                {
                  type: "null",
                },
              ],
              description: "Country of shipment (P.V/C)",
            },
            originCountry: {
              anyOf: [
                {
                  type: "string",
                },
                {
                  type: "null",
                },
              ],
              description: "Country of origin (P.O/D)",
            },
          },
          required: [
            "sequenceNumber",
            "productCode",
            "exchangeRate",
            "unitPrice",
            "commercialValue",
            "customsValueUSD",
            "quantityUMC",
            "umcCode",
            "description",
            "notes",
            "addedValueFactor",
            "shipmentCountry",
            "originCountry",
          ],
          type: "object",
        },
        type: "array",
      },
    },
    required: [
      "pedimentNumber",
      "operationType",
      "pedimentCode",
      "regime",
      "destination",
      "exchangeRate",
      "customsValue",
      "grossWeight",
      "customsOffice",
      "transportation",
      "dollarValue",
      "commercialValue",
      "taxId",
      "companyName",
      "personalId",
      "address",
      "lineItems",
    ],
    type: "object",
  },
